import React, {Component} from "react";
import { Container} from "react-bootstrap";

class SiteFooter extends Component {
    render() {
        return (
          <Container>
            <div style={{'padding-top':'20%'}} >
              <footer className='footer mt-auto py-3 text-white'>
                <div className='container'>
                  <img style={{width:150, height:60}} src={require('./media/epishare.svg')}/>
                </div>
                <p
                    style={{
                      'font-size':12
                    }}
                > For information you can contact us at admin@c3g.ca <br/>
                  740 Dr. Penfield Avenue, Room 6103 <br/>
                  Montréal, QC, Canada   H3A 0G1 <br/>
                  Copyright © 2020 EpiShare. All rights reserved. </p>

              </footer>
            </div>
          </Container>
        )
    }
}

export default SiteFooter;
